import{_ as r,c as t}from"./app.7d025128.js";const e={},p=t('<h1 id="\u7ED3\u675F\u8BED-\u5927\u9053\u81F3\u7B80" tabindex="-1"><a class="header-anchor" href="#\u7ED3\u675F\u8BED-\u5927\u9053\u81F3\u7B80" aria-hidden="true">#</a> \u7ED3\u675F\u8BED | \u5927\u9053\u81F3\u7B80</h1><p>\u4F60\u597D\uFF0C\u6211\u662F\u674E\u5175\u3002\u4E0D\u77E5\u4E0D\u89C9\u4E2D\u4E13\u680F\u5DF2\u7ECF\u66F4\u65B0\u5B8C\u4E86\uFF0C\u603B\u7684\u6765\u8BF4\uFF0C \u6211\u5199\u672C\u4E13\u680F\u7684\u8FC7\u7A0B\u662F\u75DB\u5E76\u5FEB\u4E50\u7740\u3002</p><p>\u89C9\u5F97\u75DB\u82E6\u662F\u56E0\u4E3A\u5199\u4F5C\u671F\u95F4\u6BCF\u4E00\u5929\u90FD\u80FD\u611F\u53D7\u5230\u591A\u65B9\u7684\u538B\u529B\uFF0C\u5B8C\u5168\u6CA1\u6709\u653E\u677E\u7684\u673A\u4F1A\u3002\u5728\u8FD9\u8FC7\u7A0B\u4E2D\uFF0C\u9605\u8BFB Chromium \u548C V8 \u7684\u6E90\u4EE3\u7801\u5360\u7528\u4E86\u6211\u5927\u91CF\u7684\u65F6\u95F4\uFF0C\u56E0\u4E3A\u6709\u65F6\u5019\u8981\u9A8C\u8BC1\u6587\u7AE0\u7684\u4E00\u4E9B\u89C2\u70B9\uFF0C\u6216\u8005\u627E\u51FA\u4E00\u4E9B\u77E5\u8BC6\u70B9\u7684\u5B9E\u73B0\u903B\u8F91\uFF0C\u90FD\u9700\u8981\u901A\u8FC7\u9605\u8BFB\u6E90\u4EE3\u7801\u6765\u7ED9\u51FA\u7ED3\u8BBA\u3002V8 \u7684\u6E90\u4EE3\u7801\u8FD8\u7B97\u597D\u8BFB\uFF0C\u4F46 Chromium \u7684\u6E90\u4EE3\u7801\u5C31\u8FC7\u4E8E\u590D\u6742\u4E86\uFF0C\u8981\u770B\u4E00\u4E2A\u529F\u80FD\u662F\u600E\u4E48\u5B9E\u73B0\u7684\u5C31\u5F97\u67E5\u770B\u51E0\u5341\u4E2A\u6E90\u6587\u4EF6\uFF0C\u800C\u4E14\u8FD9\u4E9B\u4EE3\u7801\u4E2D\u5145\u65A5\u7740\u5927\u91CF\u7684\u56DE\u8C03\u51FD\u6570\uFF0C\u5927\u5927\u589E\u52A0\u4E86\u9605\u8BFB\u4EE3\u7801\u7684\u96BE\u5EA6\u3002</p><p>\u5F53\u7136\u8FD9\u4E2A\u8FC7\u7A0B\u4E2D\uFF0C\u6211\u4E5F\u89C9\u5F97\u662F\u5FEB\u4E50\u7684\uFF0C\u56E0\u4E3A\u901A\u8FC7\u672C\u4E13\u680F\u6211\u89E3\u9501\u4E86\u4E24\u4EF6\u975E\u5E38\u6709\u6311\u6218\u7684\u6280\u80FD\u3002</p><p>\u7B2C\u4E00\u4EF6\u662F\u5199\u6280\u672F\u6587\u7AE0\u3002\u901A\u8FC7\u672C\u4E13\u680F\uFF0C\u6211\u5BF9\u5199\u6280\u672F\u6587\u7AE0\u6709\u4E86\u6BD4\u8F83\u7CFB\u7EDF\u6027\u7684\u65B9\u6CD5\u8BBA\uFF0C\u4E5F\u7406\u89E3\u4E86\u5199\u6280\u672F\u6587\u7AE0\u7684\u6838\u5FC3\u5C31\u662F<strong>\u7528\u7B80\u5355\u7684\u8BED\u8A00\u8BB2\u6E05\u695A\u4E00\u4E2A\u590D\u6742\u7684\u95EE\u9898</strong>\u3002\u4E0D\u8FC7\u8981\u505A\u597D\u5374\u5E76\u975E\u6613\u4E8B\uFF0C\u641E\u6E05\u695A\u76EE\u6807\u7FA4\u4F53\u3001\u5BF9\u8FD9\u4E2A\u9886\u57DF\u6709\u6DF1\u523B\u7684\u7406\u89E3\u548C\u6D1E\u89C1\u3001\u7EC4\u7EC7\u597D\u6587\u7AE0\u7684\u5C42\u6B21\u7ED3\u6784\u2026\u2026\u4E00\u6837\u90FD\u4E0D\u80FD\u5C11\uFF0C\u53EA\u6709\u8FD9\u6837\u624D\u80FD\u505A\u5230\u6709\u7684\u653E\u77E2\u3002</p><p>\u5728\u4E13\u680F\u7684\u5199\u4F5C\u8FC7\u7A0B\u4E2D\uFF0C\u6211\u8FD8\u53D1\u73B0\u4E86\u5199\u6587\u7AE0\u548C\u505A\u9879\u76EE\u7684\u76F8\u901A\u4E4B\u5904\u3002\u6211\u4EEC\u77E5\u9053\u901A\u5E38\u505A\u9879\u76EE\u65F6\u9700\u8981\u9996\u5148\u786E\u8BA4\u6838\u5FC3\u9700\u6C42\uFF0C\u5E76\u5FEB\u901F\u4EA4\u4ED8\u4E00\u4E2A\u6700\u5C0F\u53EF\u884C\u4EA7\u54C1\uFF0C\u7136\u540E\u518D\u6839\u636E\u5B9E\u9645\u7684\u9700\u6C42\u6765\u8FED\u4EE3\u4EA7\u54C1\u3002</p><p>\u800C\u5728\u8BBE\u8BA1\u4E13\u680F\u76EE\u5F55\u65F6\uFF0C\u6211\u4E5F\u6709\u610F\u8BC6\u5730\u5C06\u6587\u7AE0\u5206\u4E3A\u201C<strong>\u642D\u5EFA\u77E5\u8BC6\u67B6\u6784\u578B</strong>\u201D\u548C\u201C<strong>\u6DF1\u5165\u8BB2\u89E3\u5355\u4E2A\u77E5\u8BC6\u70B9\u578B</strong>\u201D\u3002\u201C\u642D\u5EFA\u77E5\u8BC6\u67B6\u6784\u578B\u201D\u6587\u7AE0\u7684\u4E3B\u8981\u4EFB\u52A1\u662F\u5C06\u76F8\u4E92\u5173\u8054\u7684\u77E5\u8BC6\u70B9\u4E32\u6210\u7EBF\u3001\u8FDE\u6210\u7F51\uFF0C\u8FD9\u7C7B\u6587\u7AE0\u7684\u6838\u5FC3\u4EFB\u52A1\u5C31\u662F\u505A\u8FDE\u63A5\uFF0C\u4F46\u8FD9\u8FC7\u7A0B\u4E2D\u53C8\u4F1A\u6D89\u53CA\u5230\u5F88\u591A\u77E5\u8BC6\u70B9\uFF0C\u4E0D\u8FC7\u5355\u4E2A\u77E5\u8BC6\u70B9\u662F\u600E\u4E48\u5DE5\u4F5C\u7684\u5E76\u4E0D\u662F\u6838\u5FC3\uFF0C\u56E0\u6B64\u6211\u4F1A\u5C06\u8FD9\u4E9B\u7EC6\u8282\u6027\u7684\u77E5\u8BC6\u70B9\u5173\u8FDB\u201C\u9ED1\u76D2\u201D\uFF0C\u4F60\u53EA\u9700\u8981\u4E86\u89E3\u201C\u9ED1\u76D2\u201D\u8D77\u5230\u7684\u4F5C\u7528\u662F\u4EC0\u4E48\u5C31\u884C\u4E86\uFF0C\u5E76\u4E0D\u9700\u8981\u5173\u5FC3\u5176\u5185\u90E8\u5B9E\u73B0\u7684\u7EC6\u8282\u3002\u76F8\u53CD\uFF0C\u5728\u201C\u6DF1\u5165\u8BB2\u89E3\u5355\u4E2A\u77E5\u8BC6\u70B9\u578B\u201D\u8FD9\u7C7B\u6587\u7AE0\u4E2D\uFF0C\u6211\u4F1A\u62C6\u89E3\u8FD9\u4E9B\u201C\u9ED1\u76D2\u201D\uFF0C\u5E76\u5C06\u4E00\u4E2A\u4E2A\u77E5\u8BC6\u70B9\u5206\u6790\u900F\u5F7B\u3002</p><p>\u6211\u89E3\u9501\u7684\u7B2C\u4E8C\u4E2A\u6709\u6311\u6218\u7684\u6280\u80FD\u5C31\u662F\u4E13\u680F\u5F55\u97F3\uFF0C\u4E3A\u6B64\u6211\u8FD8\u4E13\u95E8\u5B66\u4E60\u4E86\u4E00\u4E9B\u5F55\u97F3\u6280\u5DE7\uFF0C\u867D\u7136\u5F55\u97F3\u6548\u679C\u548C\u4E13\u4E1A\u4E3B\u64AD\u6BD4\u8D77\u6765\u8FD8\u6709\u4E9B\u5DEE\u8DDD\uFF0C\u4F46\u5BF9\u4E8E\u6211\u4E2A\u4EBA\u800C\u8A00\uFF0C\u8FD9\u662F\u6211\u8FC8\u51FA\u53BB\u7684\u201C\u91CD\u8981\u7684\u7B2C\u4E00\u6B65\u201D\uFF01</p><p>\u5982\u679C\u975E\u8BA9\u6211\u603B\u7ED3\u5199\u4F5C\u8FC7\u7A0B\u4E2D\u7684\u4E00\u4E9B\u7ECF\u9A8C\u548C\u5FC3\u5F97\uFF0C\u6211\u4F1A\u7528\u56DB\u4E2A\u8BCD\u6765\u6982\u62EC\uFF1A<strong>\u5927\u9053\u81F3\u7B80\uFF0C\u5B66\u4F1A\u6743\u8861\uFF0C\u61C2\u5F97\u820D\u5F03\uFF0C\u6301\u7EED\u8FDB\u5316</strong>\u3002\u5177\u4F53\u6765\u8BB2\uFF0C\u9996\u5148\u4F60\u61C2\u5F97\u4E86\u5927\u9053\uFF0C\u6709\u7740\u5168\u5C40\u89C6\u91CE\uFF0C\u624D\u6709\u80FD\u529B\u53BB\u5206\u6790\u54EA\u4E9B\u662F\u91CD\u8981\u7684\u3001\u54EA\u4E9B\u662F\u4E0D\u91CD\u8981\u7684\uFF0C\u8FD9\u6837\u4F60\u624D\u6709\u53EF\u80FD\u53BB\u5316\u7E41\u4E3A\u7B80\uFF1B\u5728\u5316\u7E41\u4E3A\u7B80\u7684\u8FC7\u7A0B\u4E2D\uFF0C\u4F60\u8FD8\u9700\u8981\u53BB\u6743\u8861\u5229\u5F0A\uFF0C\u6709\u52C7\u6C14\u53BB\u820D\u5F03\u90A3\u4E9B\u4E0D\u91CD\u8981\u7684\u6216\u8005\u5DF2\u7ECF\u82B1\u8D39\u4E86\u5927\u91CF\u7CBE\u529B\u53BB\u505A\u7684\u4E8B\uFF1B\u5B8C\u6210\u4E4B\u540E\uFF0C\u4F60\u8FD8\u9700\u8981\u6301\u7EED\u8DDF\u8FDB\uFF0C\u8FDB\u884C\u6301\u7EED\u7684\u91CD\u6784\u6539\u8FDB\uFF01</p><p>\u6211\u7279\u522B\u611F\u8C22\u6781\u5BA2\u65F6\u95F4\u7ED9\u6211\u8FD9\u6B21\u673A\u4F1A\uFF0C\u5728\u8FD9\u8FC7\u7A0B\u4E2D\uFF0C\u6211\u5B66\u4E60\u4E86\u5F88\u591A\uFF0C\u4E5F\u6210\u957F\u4E86\u5F88\u591A\u3002\u4E5F\u975E\u5E38\u611F\u8C22\u4F60\u5728\u7559\u8A00\u533A\u7684\u53CD\u9988\u548C\u610F\u89C1\uFF0C\u624D\u8BA9\u6211\u53EF\u4EE5\u6301\u7EED\u4F18\u5316\u672C\u4E13\u680F\u3002\u867D\u7136\u8FD9\u662F\u4E13\u680F\u7684\u7ED3\u675F\u8BED\uFF0C\u4E0D\u8FC7\u672C\u4E13\u680F\u8FD8\u4F1A\u6301\u7EED\u4F18\u5316\u4E0B\u53BB\uFF0C\u6211\u4F1A\u8BE6\u7EC6\u56DE\u590D\u4F60\u7684\u7559\u8A00\uFF0C\u5E76\u5BF9\u4E13\u680F\u505A\u4E00\u4E9B\u52D8\u8BEF\u548C\u7ED3\u6784\u7684\u4F18\u5316\uFF0C\u5982\u6709\u5FC5\u8981\u540E\u7EED\u6211\u8FD8\u4F1A\u51C6\u5907\u4E00\u4E9B\u52A0\u9910\u73AF\u8282\u3002</p><p>\uFF08\u5907\u6CE8\uFF1A\u7ED3\u8BFE\u8C03\u7814\u5DF2\u5B8C\u7ED3\uFF09</p>',11);function n(o,s){return p}var c=r(e,[["render",n],["__file","end.html.vue"]]);export{c as default};
